const Home = () => {
    return (

        <div id="home">

            <h1>Welcome to Stranger's Things: A place to buy and sell gently used items!</h1>
            <button>Login</button>
            <br></br> 
            <br></br>

            <h2> New to Stranger's Things?</h2>
            <button>Sign Up</button>
            <br></br>

        </div>
    )
}

export default Home;
